function Bookmark(a) {
    var url = window.document.location;
    var title = window.document.title;
    if (jQuery.browser.ie)
        window.external.AddFavorite(url, title);
    else if (jQuery.browser.opera) {
        a.href = url;
        a.rel = "sidebar";
        a.title = title;
        return true;
    }
    else if (jQuery.browser.mozilla) window.sidebar.addPanel(title, url, "");
    else alert(" CTRL-D,     .");
    return false;
}

